import React, { useState, useEffect, useReducer } from "react";
import {
  BrowserRouter as Router,
  Route,
  useHistory,
  // Switch,
  Link
  // useLocation
} from "react-router-dom";
import PropTypes from "prop-types";
import List from "./list";

/**
 * @param {goBack} 返回
 * @param {goForward} 前进
 * @param {titleObject} 图标标题
 * @param {onClickTitle} 点击事件
 * @returns
 */

import Breadcrumb from "./view";

function BreadcrumbWrap(props) {
  let history = useHistory();
  // let location = useLocation();
  const { titleObject } = props;
  const goBack = () => {
    history.goBack();
  };
  const goForward = () => {
    history.goForward();
  };
  const onClickTitle = item => {
    console.log(item.title);
    // history.push("/li");
    // history.goBack();
  };
  return (
    <div>
      <Route>
        <Router>
          <Route>
            <Breadcrumb
              goback={goBack}
              goforword={goForward}
              titleObject={titleObject} //当前渲染页面记录 (包括icon titie)
              onClickTitle={onClickTitle} //跳转页面点击事件
            />
            <Link to="/">home </Link>
            <Link to="/li">list </Link>
            <Link to="/li2">list2 </Link>
            <List />
            {/* <button type="button" onClick={() => history.push("/li")}>
              ssss
            </button> */}
          </Route>
        </Router>
      </Route>
    </div>
  );
}
BreadcrumbWrap.protoTypes = {
  titleObject: PropTypes.object,
  onClickTitle: PropTypes.func
};
BreadcrumbWrap.defaultProps = {
  titleObject: [
    {
      icon: "🍉",
      title: "IT技术"
    },
    {
      icon: "🍉",
      title: "React"
    },

    {
      icon: "🍉",
      title: "123"
    }
  ],
  onClickTitle: () => {
    console.log("clickTitle");
  }
};
export default BreadcrumbWrap;
